drop schema if exists msbx5405_finalproject;
create database msbx5405_finalproject;

use msbx5405_finalproject;

create table if not exists country
(
	countryCode int not null,
    name varchar(50),
    primary key (countryCode)
);

create table customers
(
	customerId int not null,
    custFirstName varchar(45),
    custLastName varchar(45),
    custEmail varchar(45),
    custAddress varchar(100),
    city varchar(50),
    countryCode int,
    postalCode varchar(15),
    primary key (customerId),
    foreign key (countryCode) references country(countryCode)
);

create table employees
(
	employeeId int not null,
    jobId varchar(10) not null, 
    firstName varchar(45),
    lastName varchar(45),
    gender varchar(20),
    salariedInd boolean,
    hourlyRate decimal(10,2),
    city varchar(50),
    countryCode int,
    warehouseId int,
    primary key (employeeId),
    foreign key (jobId) references positions(job_id),
    foreign key (countryCode) references country(countryCode),
    foreign key (warehouseId) references warehouse(warehouseId)
);







CREATE TABLE IF NOT EXISTS orders
(
	orderId varchar(10) NOT NULL,
    paymentAmt varchar(50),
    shippingStatus varchar(20),
    orderDate date,
    customerId int,
    primary key (orderID),
    Foreign key (customerId) references customers(customerId)
);

CREATE TABLE IF NOT EXISTS orderDetails
(
	orderId varchar(10) NOT NULL,
    productID varchar(10) NOT NULL,
    orderLineNum int,
    qtyOrdered int,
    pricePerUnit decimal(10,2),
    PRIMARY KEY (orderId,productID),
    foreign key (orderId) references orders(orderId),
    foreign key (productID) references products(productId)
);
CREATE TABLE IF NOT EXISTS returns
(
    returnId varchar(10) NOT NULL,
    orderId varchar(10),
    qtyReturned int,
    returnDate date,
    returnReason varchar(20),
    refundAmt decimal(10,2),
    resale boolean,
    PRIMARY KEY (returnId),
    foreign key (orderId) references orders(orderId)
);


CREATE TABLE IF NOT EXISTS pricing
(
    productId varchar(10) NOT NULL,
    productSize decimal(10,2),
    Unit varchar(5),
    pricePerUnit decimal(10,2),
    PRIMARY KEY (productId,productSize),
    foreign key (productId) references products(productId)
);


CREATE TABLE IF NOT EXISTS payments (
	`order_Id` VARCHAR(20) NOT NULL,
    `payment_amt` DECIMAL(18,2) NOT NULL,
    `payment_type` VARCHAR(45) NOT NULL,
    PRIMARY KEY(`order_Id`),
foreign key (`order_Id`) references orders(orderID)
);
    
CREATE TABLE IF NOT EXISTS products (
	`productId`  VARCHAR(45) NOT NULL,
     `colorId` varchar(15) NOT NULL,
    `producttype` VARCHAR(45),
    -- `Productline_id` int,
    PRIMARY KEY(`productId`),
    Foreign key (`colorId`) references productline(`colorId`)
    -- Foreign key (`Productline_id`) references productline(Productline_id)
);
    
CREATE TABLE IF NOT EXISTS productline (
	Productline_id int NOT NULL,
	`colorId` VARCHAR(15) NOT NULL,
    `toneBucket` VARCHAR(40),
    `underTone` VARCHAR(30),
    `amtBlue` DECIMAL(18,10),
    `amtRed` DECIMAL(18,10),
    `amtYellow` DECIMAL(18,10),
    `amtBlack` DECIMAL(18,10),
    PRIMARY KEY(`Productline_id`,`colorId`)
);

## Need to add index to use colorId as foreign key for products table
ALTER TABLE productline ADD INDEX colorId_idx (colorId);

    
CREATE TABLE IF NOT EXISTS warehouse (
	`warehouseId` INT NOT NULL,
    `productLine_Id` INT NOT NULL,
    `countryCode` INT NOT NULL,
    PRIMARY KEY(`warehouseId`, `productLine_Id`, `countryCode`),
foreign key (`productLine_Id`) references productLine(`Productline_id`),
foreign key (`countryCode`) references country(`countryCode`)
);


create table if not exists positions
(
	Job_id varchar(10) not null,
    Job_Title varchar(45),
    Job_Type varchar(15),
    primary key (Job_id)
);

ALTER TABLE positions ADD INDEX jobTitle_idx (Job_Title);

CREATE TABLE IF NOT EXISTS benefits
(
	`Job_Title` varchar(45) NOT NULL,
    `Job_Type` varchar(15),
    `Roth_401k` boolean,
    `HealthIns` varchar(15),
    `DentalIns` varchar(15),
    `VisionIns` varchar(15),
    primary key (`Job_title`, `Job_Type`),
    foreign key (`Job_Title`) references positions(`Job_Title`)
);

